sys_script_include.script:
var NEEDITResearchHelper = Class.create();
NEEDITResearchHelper.prototype = {
	initialize: function() {
		this.logSource = 'NEEDITResearch';
		this.verbosity = gs.getProperty('mg44.integration.NEEDITResearch.verbosity', '3');
	},

	log: function(msg, level) {
		if(!level) level=3;
		if(level <= this.verbosity) gs.log(msg, this.logSource);
	},
	type: 'NEEDITResearch'
};
